	// } else {
	result.forEach((user, index) => {
		rows.push(<UserRows user={user} key={index} />);
	});
	// }

	return (
		<div>
			<Container style={{ padding: "0px" }}>
				<Grid
					container
					spacing={2}
					style={{ border: "1px solid rgba(224, 224, 224, 1)", padding: "5px" }}
				>
					<Grid item xs={12} sm={9} md={10} lg={10} xl={10}>
						77 - Jamnagar Rular
					</Grid>
					<Grid item xs={12} sm={3} md={2} lg={2} xl={2}>
						Button
					</Grid>
				</Grid>
			</Container>
			<Table stickyHeader size="small" aria-label="a dense table">
				<TableHead>
					<TableRow>
						{HEADERS &&
							HEADERS.map((item, index) => {
								return (
									<TableCell padding="dense" key={index}>
										{item}
									</TableCell>
								);
							})}
					</TableRow>
				</TableHead>
				<TableBody>{rows}</TableBody>
			</Table>
		</div>
	);
};

export default UserTable;
